import "./App.css";
import Header from "./container/Header";
import { UserContextProvider } from "./context/userContext";


function App() {
  return (
    <div className="ui container">
    <UserContextProvider>
      <Header/>
    </UserContextProvider>
    </div>
  );
}

export default App;
